I want the website to use Genesys Messenger SDK to invoke below Messenger Widget when someone clicks on contact us option.
Also the widget is enable for Journey tracking that tracks different web URL ( full path ) the customer has clicked on.

There is one snippet shared by Genesys that does this possible. feel to make ammendments.

Journey code snippet to track URL.

<script type="text/javascript" charset="utf-8">
 Genesys("subscribe", "Journey.ready", function() {
   setTimeout(function () {
     let pathname = window.location.pathname;
     if (!pathname || pathname == "/") {
       pathname = "/home";
     }
     let segments = pathname.split('/').filter(Boolean); // Remove empty segments
     pathname = "/" + segments[segments.length - 1]; // Return last segment prefixed with "/"

     Genesys("command", "Journey.pageview", {
       pageTitle: pathname
     });
   });
 });
</script>


